window.bookSummaryJSON = "<p>Fi has always known there's something not quite right about herself.</p> <p>Not quite human.</p> <p>For as long as she can remember, Fi has been sensitive to other people's emotions. So sensitive, she works a night job as a cleaner to avoid being overwhelmed by all of their feelings.</p> <p>After a night on the town goes wrong, Fi comes to the attention of the Academy of Avalon. The obscenely beautiful jerk of a man who comes to collect her confirms her suspicions - Fi isn't human at all.</p> <p>But all is not as it seems in Avalon. Magic is dying, those who have it are hunted, and at least one person really doesn't want Fi there.</p> <p>Fi also has to figure out how to deal with the insane magnetic pull she feels to some of the most gorgeous and magically powerful males at the academy. What's a little boy-drama on top of an identity crisis?</p> <p><b>Contains mature themes.</b></p>"; 
